import initialState from './initialState';

const modalReducer = (initialState, action) => {
  switch(action.type) {
    case 'MODAL_TOGGLE': {
      return Object.assign({}, initialState, {modal_visibile: !initialState.modal_visibile});
    }
  default:
    return initialState;
  }
};

export default modalReducer;
